        <svg repeat.for="link of links">

            <path class="link_line link_path" d.bind="link.svgcurve"></path>

        </svg>
        <svg repeat.for="node of nodes">

            <g transform="translate(${node.r?86:-25},${2+(node.h-30)/2})" class="node_button ${node.r?'node_right_button':'node_left_button'}" opacity="1">
              <rect rx="5" ry="5" width="32" height="26" fill="#eee" fill-opacity="0.2"></rect>
              <rect class="node_button_button" x="${node.r?12:5}" y="4" rx="4" ry="4" width="16" height="18" fill="${node.col}" cursor="pointer" fill-opacity="0.2"></rect>

            <rect class="node" rx="5" ry="5" fill="${node.col}" width="${node.w}" height="${node.h}"></rect>

            <g class="node_icon_group ${node.r?'node_icon_group_right':''}" x="0" y="0" style="pointer-events: none;" transform="${node.r?'translate('+(node.w-30)+',0)':''}">
              <rect x="0" y="0" class="node_icon_shade" width="30" stroke="none" fill="#000" fill-opacity="0.05" height="${node.h}"></rect>
              <image xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="icons/${node.icon}" class="node_icon" x="5" width="20" height="30" y="${(node.h - 30)/2}"></image>
              <path d="M 30 1 l 0 ${node.h-2}" class="node_icon_shade_border" stroke-opacity="0.1" stroke="#000" stroke-width="1"></path>
            </g>

            <text class="node_label " x="38" dy=".35em" text-anchor="start" y="${node.h/2}">${node.label}</text>
            <!--text class="node_label node_label_right " x="62" dy=".35em" text-anchor="end" y="14">msg ⇲</text-->

              <text class="node_status_label" x="20" y="9"></text>
            </g>

            <image class="node_error hidden" xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="icons/node-error.png" x="190" y="-6" width="10" height="9"></image>
            <image class="node_changed hidden" xmlns:xlink="http://www.w3.org/1999/xlink" xlink:href="icons/node-changed.png" x="190" y="-6" width="10" height="10"></image>

            <g class="port_input" transform="translate(-5,${10+(node.h-30)/2})">
              <rect class="port" rx="3" ry="3" width="10" height="10"></rect>
            </g>

            </g>
